import React, { useState } from "react";

export default function Head() {
  return (
<>
      <nav class="navbar navbar-light bg-body-tertiary border border-secondary border-3 opacity-100 p-4 " dir="rtl">
        <div class="container-fluid">
            <img src="./img/logo.png"  style={{ width: '450px', height: '120px' }} />
            <h4>simple iban checker made my mohab </h4>

        </div>
      </nav>

      </>
  );
}
